import './App.css';

function App() {
  return (
    <div className="App">
      <div className="datos w-2/4">
        <h2 className="text-xl">Gestión de inventario</h2>
        <label>Nombre del producto:<input type="text"></input></label>
        <label>Presentación:</label>
        <label>250GR<input type="radio"></input></label>
        <label>500GR<input type="radio"></input></label>
        <label>1KG<input type="radio"></input></label>
        <label>5KG<input type="radio"></input></label>
        <label>Cantidad:<input type="number"></input></label>
        <button>Registrar</button>
      </div>
    </div>
  );
}

export default App;
